import React from "react";
import ReactDom from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import Home from "./Components/Home";

ReactDom.render(
    <>
        <BrowserRouter>
            <App />
            <Home/>
        </BrowserRouter>
    </>,
    document.getElementById('root'));
